import { useEffect, useState } from "react";
import axios from "axios";

const Play = ({ token }) => {
    const [ userData, setUserData ] = useState();

    useEffect(() => {
        axios.post('http://localhost:5000/accounts/me', {
            token: token,
        }).then(response => {
            setUserData(response.data);
        })
    }, [])

    return(
        <h1>Play {userData.username} </h1>
    );
}

export default Play;
